s = requests.Session()
for kind, ims in IMAGES.items():
    os.makedirs(kind, exist_ok=True)
    it = ims.items() if type(ims) is dict else enumerate(ims)
    assert type(ims) is dict or len(ims) == 10, kind
    for loc, url in it:
        im = s.get(url, headers={
            'User-Agent': 'Nyaaaaaaaaaaaaaaaaaaa. Yulia Sireneva <me@purplesyringa.moe>',
        }).content
        if type(ims) is dict:
            im = geotag.tag_plus(im, loc)
            assert geotag.untag_plus(im) == loc, loc
        with open(os.path.join("/private", kind, str(loc)), "wb") as f:
            f.write(im)
